import React from "react";
import "./LastSensors.scss";
import { RootState } from "../../../types/interfaces";
import { useSelector } from "react-redux";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  LinearProgress,
} from "@mui/material";

function LastSensors() {
  const sensors = useSelector((state: RootState) => state.containers);

  return (
    <div>
      <Typography variant='h3'>Last Sensors</Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Sensor ID</TableCell>
              <TableCell>Product name</TableCell>
              <TableCell>Product capacity </TableCell>
              <TableCell>Quantity</TableCell>
              <TableCell>Measure</TableCell>
              <TableCell>Fill percentage</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {sensors.map((sensor) => (
              <TableRow key={sensor.id}>
                <TableCell>{sensor.id}</TableCell>
                <TableCell>{sensor.container.product.productName}</TableCell>
                <TableCell>{sensor.container.product.capacity}</TableCell>
                <TableCell>{sensor.quantity}</TableCell>
                <TableCell>
                  {sensor.container.product.measure.measureName}
                </TableCell>
                {/*  другие данные  */}
                {/* <TableCell
                  style={{
                    backgroundColor: getColor(
                      Number(sensor.container.product.capacity),
                      Number(sensor.quantity)
                    ),
                  }}
                >
                  {getFillPercentage(
                    Number(sensor.container.product.capacity),
                    Number(sensor.quantity)
                  )}
                  %
                </TableCell> */}
                <TableCell>
                  <LinearProgress
                    variant='determinate'
                    value={fillPercentage}
                    style={{ width: "100%" }}
                  />
                  {`${fillPercentage.toFixed(0)}%`}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

function getFillPercentage(capacity: number, filled: number) {
  return Math.round((filled / capacity) * 100);
}

function getColor(capacity: number, filled: number) {
  const percentage = getFillPercentage(capacity, filled);
  if (percentage > 75) {
    return "green";
  } else if (percentage > 50) {
    return "yellow";
  }
  return "red";
}

export default LastSensors;
